import React, {Component} from 'react';
import './App.css';
import Header from "../header/Header";
import Section from "../sections/Section";

class App extends Component {
  render() {
      return (
        <div className="App">
          <Header />
          <Section></Section>
        </div>
      );
  }
}
export default App;
